import React, { Component } from "react";
import "./opinionList.style.css";
import { Link } from "react-router-dom";
import DocumentTag from "./DocumentTag";
import moment from "moment";

export class OpinionList extends Component {
  constructor(props) {
    super(props);
    this.state = {
      documentList: "",
      search: "",
    };
  }

  render() {
    return (
      <div>
        <div className="documentroom_container">
          <div className="documentroom_text">오피니언</div>

          <div className="documentroom_table">
            <div className="table_head">
              <div className="table_head_text1">No.</div>
              <div className="table_head_text2">제목</div>
              <div className="table_head_text3">작성자</div>
              <div className="table_head_text4">등록날짜</div>
              <div className="table_head_text4">조회수</div>
            </div>

            <ul className="post-ul">
              <li className="post-li">
                <ul className="post-row-list">
                  <li className="post-row-list-item1">안녕</li>
                  <li className="post-row-list-item2">2020. 08. 06.</li>
                  <li className="post-row-list-item3">
                    ㅋㅋㅋ
                    <div className="post-row-list-item-tag">
                      <DocumentTag text={"야야야야"} />
                    </div>
                  </li>
                  <li className="post-row-list-item4">
                    <button className="post-row-list-item-btn"></button>
                  </li>
                </ul>
              </li>
            </ul>
          </div>

          <div className="pagination-div">
            <div className="pagination">
              <Link
                to={`?pageNo=1`}
                className="page_button"
                onClick={this.pageNext}
                id="1"
              >
                1
              </Link>
              <Link
                to={`?pageNo=2`}
                className="page_button"
                onClick={this.pageNext}
                id="2"
              >
                2
              </Link>
              <Link
                to={`?pageNo=3`}
                className="page_button"
                onClick={this.pageNext}
                id="3"
              >
                3
              </Link>
              <Link
                to={`?pageNo=4`}
                className="page_button"
                onClick={this.pageNext}
                id="4"
              >
                4
              </Link>
              <Link
                to={`?pageNo=5`}
                className="page_button"
                onClick={this.pageNext}
                id="5"
              >
                5
              </Link>
            </div>
          </div>

          <div className="conference_search">
            <select className="search_select">
              <option className="search_option" value="회의제목">
                회의제목
              </option>
              <option className="search_option" value="회의시간">
                회의시간
              </option>
            </select>

            <input
              placeholder="회의 제목이나 날짜를 입력하세요"
              className="search_input"
              onChange={(e) => {
                this.setState({
                  search: e.target.value,
                });
              }}
            />
            <Link
              to={`?search=${this.state.search}`}
              className="search_button"
              onClick={this.search}
            >
              검색
            </Link>
          </div>
        </div>
      </div>
    );
  }
}

export default OpinionList;
